INSERT INTO `documentos_tipos` VALUES ('1', 'Identificación oficial', null, '¿IFE o Pasaporte coincide con Nombre del Solicitante?', '1', '0', 'Solicitante', '1', null, '2018-05-29 12:08:21', null, 'Puede ser INE / IFE por ambos lados o Pasaporte'), ('2', 'Comprobante de domicilio', null, '¿Comprobante de	domicilio coincide con solicitud y es menor	a 3	meses?', '1', '0', 'Solicitante', '1', null, '2018-05-29 12:08:21', null, 'Debe coincidir con el domicilio registrado y ser de los últimos tres meses. (i.e Recibo Telefono, Gas o CFE). Deberá estar a nombre del cliente o de un familiar en línea directa (Cónyuge,Padres, Hermanos e Hijos).'), ('3', 'Predial', null, '¿Predial viene a nombre del Solicitante u Obligado Solidario o Rentero?', '1', '0', 'Solicitante', '1', null, '2018-05-29 12:08:21', null, 'Debe coincidir con el domicilio registrado y ser de los ultimos tres meses.'), ('4', 'Autorización revisión buró x', null, '', '0', '0', 'Solicitante', '1', null, '2018-05-29 12:08:21', null, null), ('5', 'Últimos estados de cuenta', null, '¿Nombre del Solicitante coincide con Nombre Estados de Cuenta?', '1', '0', 'Solicitante', '1', null, '2018-05-29 12:08:21', null, 'Puedes subir los últimos 3 meses de los estados de cuenta de tu cuenta bancaria. También puedes subir tus últimos 3 recibos de nómina.'), ('6', 'Recibo energía eléctrica', null, '¿Dirección del Recibo de Luz es igual a la Dirección del Solicitante?', '1', '0', 'Técnico', '1', null, '2018-05-29 12:08:21', null, '\"Recibo de Luz de CFE\" por ambos lados. (Debe coincidir con el domicilio registrado).'), ('7', 'Propuesta técnica proveedor', null, '¿Propuesta tecnica coincide	con	el numero de paneles y capacidad del sistema?', '1', '0', 'Técnico', '1', null, '2018-05-29 12:08:21', null, 'Propuesta técnica del proveedor solar que al menos contenga la siguiente información: 1) ahorros proyectados de un año, 2) generación proyectada de un año, 3) número de paneles y capacidad de cada panel.'), ('8', 'Cotización proveedor', null, '¿Se habló	con instalador solar?', '1', '0', 'Técnico', '1', null, '2018-05-29 12:08:21', null, 'Cotización económica del proveedor solar. Deberá coincidir con la información proporcionada.'), ('9', 'Identificación oficial Obligado Solidario', null, '¿IFE o Pasaporte coincide con Nombre Obligado Solidario?', '1', '0', 'Aval', '1', null, '2018-05-29 12:08:21', null, 'Puede ser INE / IFE por ambos lados o Pasaporte'), ('10', 'Comprobante domicilio Obligado Solidario', null, '¿Dirección del Recibo de Luz es igual a la Dirección del Obligado Solidario?', '1', '0', 'Aval', '1', null, '2018-05-29 12:08:21', null, 'Debe ser de los últimos tres meses. (i.e Recibo Telefono, Gas o CFE).'), ('11', 'Autorización revisión buró Obligado Solidario', null, '¿Nombre	del	aval coincide con estados de cuenta?', '1', '0', 'Aval', '1', null, '2018-05-29 12:08:21', null, 'Debe poder descargar la Forma y subirla aquí, antes de autorizar el crédito.'), ('12', 'Comprobante de Ingresos Obligado Solidario', null, 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Deserunt dolore ducimus eveniet fugiat placeat ', '1', '0', 'Aval', '1', null, '2018-05-29 12:08:21', null, 'Puedes subir los últimos 3 meses de los estados de cuenta de tu cuenta bancaria. También puedes subir tus últimos 3 recibos de nómina.'), ('13', 'Identificación oficial rentero', null, '¿Nombre en IFE del Rentero coincide con Nombre del Predial?', '1', '0', 'Rentero', '1', null, '2018-05-29 12:08:21', null, 'Puede ser INE / IFE por ambos lados o Pasaporte'), ('14', 'Predial / Contrato arrendamiento', null, 'Predial	viene a	nombre del aval	y coincide con la direccion del	solicitante? <br> ¿El contrato de arrendamiento es entre	el solicitante y el	aval y coincide con el domicilio?', '1', '0', 'Rentero', '1', null, '2018-05-29 12:08:21', null, 'Debe ser Predial o Contrato de Arrendamiento con el Solicitante'), ('15', 'Acta constitutiva', null, '', '1', '0', 'Negocio', '1', null, '2018-05-29 12:08:21', null,